【商品説明】 <br>
ワイドタイプのドアバイザー<br>
愛車がクールにドレスアップ<br><br>


※両面テープ貼付済み<br>
※付属の両面テープだけでは落下する場合がございます。<br>
別途両面テープをご準備いただき、全面にテープを付着させてることをお勧めいたします。<br><br>


特徴・注意事項<br><br> ※装着前にお客様の方で、必ず仮合わせのうえ、装着のほうお願いします。 <br><br>
※取り付けの際は、両面テープ装着部分の汚れ等を十分に落としてから行って下さい。 <br><br>
※取り付け説明書が付属していない車種も御座います。  <br><br>
送料 全国一律送料無料<BR>
      沖縄県全域。離島は別途送料必要 <br><br><br><br><br>


